import React, { useState } from "react";
import "../Trucks.css";

function Trucks() {
  const [trucks, setTrucks] = useState([
    { id: 1, model: "Volvo FH16", plate_number: "ABC-123", status: "Available", created_at: "2025-03-19T10:00" },
    { id: 2, model: "Scania R450", plate_number: "XYZ-789", status: "In Use", created_at: "2025-03-18T12:30" },
  ]);

  return (
    <div className="trucks-container">
      <h2>Trucks</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th><th>Plate Number</th><th>Model</th><th>Status</th><th>Created At</th>
          </tr>
        </thead>
        <tbody>
          {trucks.map(truck => (
            <tr key={truck.id}>
              <td>{truck.id}</td>
              <td>{truck.plate_number}</td>
              <td>{truck.model}</td>
              <td>{truck.status}</td>
              <td>{truck.created_at}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Trucks;
